import React, { useState } from "react";

interface EditUserProfileProps {
  name?: string;
  username: string;
  bio?: string;
  location?: string;
  interests?: string[];
  classes?: string[];
  onSave: (updatedProfile: {
    name?: string;
    username: string;
    bio?: string;
    location?: string;
    interests: string[];
    classes: string[];
  }) => void;
}

const EditUserProfile: React.FC<EditUserProfileProps> = ({
  name: initialName = "",
  username: initialUsername,
  bio: initialBio = "",
  location: initialLocation = "",
  interests: initialInterests = [],
  classes: initialClasses = [],
  onSave,
}) => {
  const [name, setName] = useState(initialName);
  const [username, setUsername] = useState(initialUsername);
  const [bio, setBio] = useState(initialBio);
  const [location, setLocation] = useState(initialLocation);
  const [interests, setInterests] = useState(initialInterests);
  const [classes, setClasses] = useState(initialClasses);

  // Handlers to add/remove interests and classes
  const addInterest = () => setInterests([...interests, ""]);
  const updateInterest = (index: number, value: string) => {
    const updated = [...interests];
    updated[index] = value;
    setInterests(updated);
  };
  const removeInterest = (index: number) => {
    setInterests(interests.filter((_, i) => i !== index));
  };

  const addClass = () => setClasses([...classes, ""]);
  const updateClass = (index: number, value: string) => {
    const updated = [...classes];
    updated[index] = value;
    setClasses(updated);
  };
  const removeClass = (index: number) => {
    setClasses(classes.filter((_, i) => i !== index));
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    // Call onSave with updated data
    onSave({
      name,
      username,
      bio,
      location,
      interests: interests.filter(i => i.trim() !== ""),
      classes: classes.filter(c => c.trim() !== ""),
    });
  };

  return (
    <form onSubmit={handleSubmit} className="edit-user-profile">
      <div>
        <label>
          Name: <br />
          <input value={name} onChange={e => setName(e.target.value)} />
        </label>
      </div>

      <div>
        <label>
          Username: <br />
          <input value={username} onChange={e => setUsername(e.target.value)} required />
        </label>
      </div>

      <div>
        <label>
          Location: <br />
          <input value={location} onChange={e => setLocation(e.target.value)} />
        </label>
      </div>

      <div>
        <label>
          Bio: <br />
          <textarea value={bio} onChange={e => setBio(e.target.value)} />
        </label>
      </div>

      <div>
        <label>Interests:</label>
        {interests.map((interest, idx) => (
          <div key={idx} style={{ display: "flex", marginBottom: 4 }}>
            <input
              value={interest}
              onChange={e => updateInterest(idx, e.target.value)}
              style={{ flexGrow: 1 }}
            />
            <button type="button" onClick={() => removeInterest(idx)}>
              &times;
            </button>
          </div>
        ))}
        <button type="button" onClick={addInterest}>
          + Add Interest
        </button>
      </div>

      <div>
        <label>Classes:</label>
        {classes.map((cls, idx) => (
          <div key={idx} style={{ display: "flex", marginBottom: 4 }}>
            <input
              value={cls}
              onChange={e => updateClass(idx, e.target.value)}
              style={{ flexGrow: 1 }}
            />
            <button type="button" onClick={() => removeClass(idx)}>
              &times;
            </button>
          </div>
        ))}
        <button type="button" onClick={addClass}>
          + Add Class
        </button>
      </div>

      <button type="submit" style={{ marginTop: 16 }}>
        Save
      </button>
    </form>
  );
};

export default EditUserProfile;
